[[package]]
name = "beartype"
version = "0.9.1"
description = "Unbearably fast runtime type checking in pure Python."
category = "main"
optional = false
python-versions = ">=3.6.0"

[package.extras]
all = ["typing-extensions (>=3.10.0.0)"]
dev = ["coverage (>=5.5)", "sphinx", "typing-extensions", "mypy (>=0.800)", "numpy", "pytest (>=4.0.0)", "tox (>=3.20.1)", "sphinx (>=4.1.0)"]
doc-rtd = ["sphinx (==4.1.0)", "sphinx-rtd-theme (==0.5.1)"]
test-tox = ["sphinx", "typing-extensions", "mypy (>=0.800)", "numpy", "pytest (>=4.0.0)"]
test-tox-coverage = ["coverage (>=5.5)"]

[[package]]
name = "boto3"
version = "1.20.4"
description = "The AWS SDK for Python"
category = "main"
optional = false
python-versions = ">= 3.6"

[package.dependencies]
botocore = ">=1.23.4,<1.24.0"
jmespath = ">=0.7.1,<1.0.0"
